import React from 'react';
import { Link, Route, Switch, useLocation } from 'react-router-dom';
import { Menu} from 'antd';

console.log("tôi là setting");
function SecurityAndLogin() {
    const { SubMenu } = Menu;
    const SecurityAndLogin = () => {
        return (
            <>
                <h1>Tôi là se & log</h1>
            </>
        )
    }
    return (
        <Switch>
            <Route path="/setting/securityandlogin" component={SecurityAndLogin} />
        </Switch>
    )
}

export default SecurityAndLogin;
